    [],nt"num_tags": 5,nt"name": "great-meadows-national-wildlife-refuge-monthly-narrative-september-december-1993",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Great
    Meadows National Wildlife Refuge outlines Refuge accomplishments during the months
    of September through December 1993. The report begins with a summary of the month's
    weather conditions. Refuge administration is outlined; information about personnel,
    volunteer programs, and safety is given. Habitat management is also covered; subjects
    include wetlands. The wildlife section of the report discusses endangered and threatened
    species, waterfowl, marsh birds and waterbirds, and raptors. The public uses of
    the Refuge described in this report include outdoor classrooms, interpretive programs,
    wildlife observation, and law enforcement. The equipment and facilities section
    of the report provides information about computer systems.",nt"owner_org":
